import React from "react";
import classes from "./HomeWorks.module.css";
import manstand from "../../../assets/manstand.png";
import worklaptop from "../../../assets/worklaptop.png";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const HomeWorks = () => {
  return (
    <React.Fragment>
      <div className={classes.workhead}>
        <h1>What I Do ?</h1>
      </div>
      <div className={classes.hbox}>
        <div className={classes.hleftBox}>
          <img className={classes.man} src={manstand} />
          <img className={classes.lappy} src={worklaptop} />
        </div>
        <div className={classes.hrightBox}>
          <div className={classes.head1}>
            <h2>Full Stack Development</h2>
          </div>
          <FontAwesomeIcon icon="fa-brands fa-html5" />
          <div className={classes.head2}>
            <FontAwesomeIcon icon={["fa-brands fa-html5"]} />
            <FontAwesomeIcon icon="fa-brands fa-css3" />
            <FontAwesomeIcon icon="fa-brands fa-js" />
            <FontAwesomeIcon icon="fa-brands fa-react" />
            <FontAwesomeIcon icon="fa-brands fa-node-js" />
            <FontAwesomeIcon icon="fa-brands fa-npm" />
            <FontAwesomeIcon icon="fa-brands fa-yarn" />
          </div>
        </div>
      </div>
    </React.Fragment>
  );
};

export default HomeWorks;
